  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0100065 includes chemical,
  physical and time series data collected from MOORINGS in the North Atlantic Ocean
  from 2005-10-22 to 2007-10-01. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT SATURATION, Partial pressure (or
  fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon
  dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
  these data include Bubble type equilibrator for autonomous carbon dioxide (CO2)
  measurement and Carbon dioxide (CO2) gas analyzer.nnThese data were collected by
  Nicholas Bates of Bermuda Biological Station for Research and Adrienne Sutton, Christopher
  Sabine and Stacy Maenner of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory
  as part of the Mooring_BTM_64W_32N data set. CDIAC associated the following cruise
  ID(s) with this data set: BTM_20051022nnThe Global CO2 Time-series and Moorings
  Project involves international groups from 18 countries who have mounted sensors
  on moored buoys to provide high resolution time-series measurements of atmospheric
  boundary layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series
  and Moorings Project is coordinated by UNESCO International Ocean Carbon Coordination
  Project (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
